import axios from "axios";

export function getAllCities() {
  return dispatch => {
    console.log("byeeee");
    axios.get(`/api/cities`).then(res => {
      dispatch(cityInfo(res.data));
      console.log("holaaaaaa");
    });
  };
}

export function cityInfo(city) {
  return {
    type: "ADD_City",
    cities: city
  };
}
